        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>Настоящий стандарт распространяется на прутки и трубы круглого сечения из бронз и латуней, изготовляемые методом горизонтального литья и используемые для нужд экономики страны и экспорта.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>Требования 2.3 являются рекомендуемыми. Остальные требования настоящего стандарта являются обязательными.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>&nbsp;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: center; line-height: normal;" align="center"><span>1. СОРТАМЕНТ</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>&nbsp;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>1.1. Прутки и трубы изготавливают из следующих марок сплавов: ЛЦ40С, Бр03Ц7С5Н1, Бр03Ц12С5, Бр05Ц5С57.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>1.2. Наружные диаметры прутков и труб и толщины стенок труб должны соответствовать <span class="GramE">указанным</span> в таблице 1.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>&nbsp;</span></p>
        <p id="P0020" class="formattext topleveltext" align="justify"><span>Таблица 1</span><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>
