        <p class="formattext topleveltext" align="justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>По соглашению изготовителя с потребителем допускается изготовление прутков и труб других наружных диаметров.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>Теоретическая масса 1 м прутков и труб приведена в Приложении А.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>1.3. Прутки и трубы должны изготовляться длиной, кратной 400 мм, но не более 2000 мм.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>Примеры условных обозначений</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>прутка из бронзы марки Бр05Ц5С5 диаметром 40 мм, длиной 800 мм, второй группы:</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: center; line-height: normal;" align="center"><span>Пруток Бр05Ц5С5 40 х 800-2, ГОСТ 24301-93;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>трубы из латуни марки ЛЦ40С наружным диаметром 60 мм, толщиной стенки 16 мм, длиной 400 мм, первой группы:</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: center; line-height: normal;" align="center"><span>Труба ЛЦ40С 60 х 16 х 400-1, ГОСТ 24301-93.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>&nbsp;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: center; line-height: normal;" align="center"><span>2. ТЕХНИЧЕСКИЕ ТРЕБОВАНИЯ</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>&nbsp;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>2.1. Прутки и трубы необходимо изготовлять в соответствии с требованиями настоящего стандарта по технологической инструкции, утвержденной в установленном порядке, из сплавов с химическим составом по ГОСТ 613 - для бронз и ГОСТ 17711 - для латуней.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>2.2. Металл по сечению прутков и труб должен быть плотным, не содержать посторонних включений и газовых раковин.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>2.3. Поверхность прутков и труб должна быть без трещин, раковин и неметаллических включений. Допускаются дефекты поверхности при условии, что они не распространяются в глубину более чем на половину разности измеренного диаметра и минимально допустимого.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>Допускаются гребешки, образующиеся из-за выработки кристаллизаторов и дорнов, если они при контрольной обточке не выводят размеры заготовок за предельные отклонения по наружному и внутреннему диаметрам.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>2.4. Допуск овальности прутков и допуски овальности и концентричности труб не должны выводить их размеры за предельные отклонения по наружным диаметрам и толщине стенки.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>2.5. Механические свойства прутков и труб должны соответствовать <span class="GramE">указанным</span> в таблице 2.</span></p>
