        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>2.7. Предельные отклонения толщины стенок труб должны соответствовать <span class="GramE">указанным</span> в таблице 4.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>&nbsp;</span></p>
