        <p id="P0040" class="formattext topleveltext" align="justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>2.8. Предельные отклонения по длине (от 800 до 2000 мм) не должны превышать +/- 15 мм для прутков и труб первой группы, +/- 20 мм - второй группы, а кривизна на 1 м длины - значений, мм:</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>3 - для прутков и труб из бронзы;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>10 - для прутков и труб из латуни.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>2.9. Прутки и трубы с конкретными требованиями по механическим свойствам и предельным отклонениям размеров изготовляют по соглашению изготовителя с потребителем.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>&nbsp;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: center; line-height: normal;" align="center"><span>3. ПРАВИЛА ПРИЕМКИ</span></p>
        <p style="margin-bottom: 0.0001pt; text-indent: 27pt; line-height: normal; text-align: justify;"><span>&nbsp;</span></p>
        <p style="margin-bottom: 0.0001pt; text-indent: 27pt; line-height: normal; text-align: justify;"><span>3.1. Прутки и трубы принимают партиями. Партия должна состоять из прутков и труб одной марки сплава, одного типоразмера и должна быть оформлена одним документом о качестве, содержащим:</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>товарный знак или наименование и товарный знак предприятия-изготовителя;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>условное обозначение прутков или труб;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>номер партии;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>массу партии;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>марку сплава;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>размер и количество прутков или труб;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>результаты механических испытаний и химического анализа (по требованию потребителя);</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>обозначение настоящего стандарта.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>3.2. Для проверки механических свойств и контроля химического состава отбирают не менее двух прутков или труб от партии.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>На предприятии-изготовителе допускается проводить проверку химического состава на пробах, взятых от расплавленного металла.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>3.3. Контролю качества наружной и внутренней поверхностей и качества металла по сечению подвергают каждый полуфабрикат (пруток, трубу).</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>3.4. Для контроля размеров от партии отбирают 5% прутков или труб.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>3.5. При получении неудовлетворительных результатов испытаний хотя бы по одному из показателей по нему проводят повторное испытание на удвоенной выборке, взятой из той же партии, и результаты повторных испытаний распространяют на всю партию.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>&nbsp;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: center; line-height: normal;" align="center"><span>4. МЕТОДЫ КОНТРОЛЯ</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>&nbsp;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>4.1. Отбор и подготовка проб для химического анализа - по ГОСТ 24231.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>Определение химического состава - по ГОСТ 25086, ГОСТ 1953.1 - ГОСТ 1953.16 или другими методами, не уступающими по точности <span class="GramE">стандартным</span>.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>При возникновении разногласий в оценке химического состава химический состав определяют по ГОСТ 25086, ГОСТ 1953.1 - ГОСТ 1953.16.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>4.2. Отбор проб для испытаний на растяжение - по ГОСТ 24047. Испытания на растяжение - по ГОСТ 1497. Испытания на твердость - по ГОСТ 9012.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>4.3. Контроль качества поверхности прутков и труб и металла по сечению должен проводиться визуально без применения увеличительных приборов.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>Высота гребешков измеряется <span class="SpellE">штангенрейсмассом</span> по ГОСТ 164.&nbsp;&nbsp;&nbsp; <br /></span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>4.4. Контроль диаметров прутков и труб, их предельных отклонений и толщины стенок труб должен проводиться штангенциркулем по ГОСТ 166.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>Контроль кривизны должен проводиться <span class="SpellE">штангенрейсмассом</span> по ГОСТ 164.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>Контроль длины прутков и труб проводят измерительной металлической рулеткой по ГОСТ 7502 или линейкой по ГОСТ 427.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>&nbsp;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: center; line-height: normal;" align="center"><span>5. МАРКИРОВКА, УПАКОВКА, ТРАНСПОРТИРОВАНИЕ И ХРАНЕНИЕ</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>&nbsp;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>5.1. На торцах или боковой поверхности прутков и труб должны быть нанесены:</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>номер плавки;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>товарный знак предприятия-изготовителя;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>цветная маркировка по ГОСТ 614 и ГОСТ 1020 для соответствующей по химическому составу марки сплава.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>5.2. Прутки и трубы транспортируют <span class="GramE">сформированными</span> в пакеты по нормативно-технической документации.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>5.3. Продукция, направляемая в районы Крайнего Севера и приравненные к ним районы, должна быть упакована по ГОСТ 15846.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>5.4. Транспортная маркировка - по ГОСТ 14192.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>5.5. Транспортирование проводят всеми видами транспорта в соответствии с правилами перевозки грузов, действующими на данном виде транспорта.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>5.6. При транспортировании и хранении прутки и трубы должны быть защищены от механических повреждений и действия активных химических веществ.</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>&nbsp;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>&nbsp;</span></p>
        <p style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 27pt; line-height: normal;"><span>&nbsp;</span></p>
